import axios from "axios";
import { useEffect, useState } from "react";
import { Link } from "react-router-dom";

function My_Product(){

let token = localStorage.getItem("token");
const [data,setData] = useState({});
console.log(data)
function renderData(){
    if(Object.keys(data).length > 0){
        return Object.keys(data).map((key,index)=>{
            let images = data[key]["image"];
                images = JSON.parse(images);
            return(   
                <tr>
                    <td>{data[key]["id"]}</td>
                    <td>{data[key]["name"]}</td>
                    <td><img src={"http://localhost:8080/laravel8/laravel8/public/api/public/upload/product/" + data[key]["id_user"] + "/" + images} alt=""></img></td>
                    <td>{data[key]["price"]}</td>
                </tr>   
            )
        })
    }
}
useEffect(()=>{
    let config = {
        headers: {
            'Authorization': 'Bearer '+ token,
            'Content_Type': 'multipart/form/data',
            'Accept': 'application/json'
        }
    };
    axios.get("http://localhost:8080/laravel8/laravel8/public/api/user/my-product", config)
    .then(res=>{
        console.log(res.data.data)
        setData(res.data.data)
    
    })
},[]);



    return(
        <div>
            <table>
            <tr>
                <th>ID</th>
                <th>Name</th>
                <th>Image</th>
                <th>Price</th>
                <th>Action</th>
            </tr>
            {renderData()} 
            </table>
        <p><Link to={"http://localhost:3000/account/myproduct/addproduct"} >Add</Link></p>
        </div>
    )
}
export default My_Product;
